// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import {GeneralBallot} from "./GeneralBallot.sol";

contract BallotGenerator {
    function generateBallot(
        uint _ballotType,
        address _electionAddress
    ) public returns (address) {
        if (_ballotType == 1) {
            return address(new GeneralBallot(_electionAddress));
        }

        return address(new GeneralBallot(_electionAddress));
    }
}

contracts/ballots/GeneralBallot.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "./Ballot.sol";

contract GeneralBallot is Ballot {
    error OwnerPermissioned();

    address public electionContract;

    uint[] private candidateVotes;

    modifier onlyOwner() {
        if (msg.sender != electionContract) revert OwnerPermissioned();
        _;
    }

    constructor(address _electionAddress) {
        electionContract = _electionAddress;
    }

    function init(uint totalCandidate) external onlyOwner {
        candidateVotes = new uint[](totalCandidate);
    }

    function vote(uint256 _candidateId) external onlyOwner {
        candidateVotes[_candidateId]++;
    }

    function getVotes() external view onlyOwner returns (uint256[] memory) {
        return candidateVotes;
    }
}

